webpackJsonp([0xcde72b36eeaa],{814:function(a,e){a.exports={data:{markdownRemark:{html:'<style>\n.contents {\n  margin-left: 1.45rem;\n  margin-right: 1.45rem;\n  border-radius: 0.3em;\n  width: 60%;\n}\n</style>\n<p>The Submissions page of the Program Dashboard shows data on all report submissions broken up by different metrics.</p>\n<div class="background contents" markdown="1">\n<table>\n<thead>\n<tr>\n<th>You can view data for these metrics on the Submissions page:</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><a href="#submissions">Submissions</a></td>\n</tr>\n<tr>\n<td><a href="#severity">Severity</a></td>\n</tr>\n<tr>\n<td><a href="#closed">Closed Report States</a></td>\n</tr>\n<tr>\n<td><a href="#weaknesses">Weaknesses</a></td>\n</tr>\n<tr>\n<td><a href="#assets">Assets</a></td>\n</tr>\n<tr>\n<td><a href="#all-time">All-time Metrics</a></td>\n</tr>\n</tbody>\n</table>\n</div>\n<p>You can export all of your data at once or by sections to a CSV or PDF file.</p>\n<h3 id="submissions">Submissions</h3>\nThe Submissions section provides a quick overview of your report submission metrics to see any report submission trends. You can view:<br><br>\n<table>\n<thead>\n<tr>\n<th>Item</th>\n<th>Details</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td># Submissions</td>\n<td>The total number of reports submitted to the program during the selected time interval.</td>\n</tr>\n<tr>\n<td># Valid</td>\n<td>The number of reports submitted during the selected time interval that are currently Triaged or Resolved.</td>\n</tr>\n<tr>\n<td># In Triage</td>\n<td>The number of reports submitted during the selected time interval that are currently Triaged.</td>\n</tr>\n<tr>\n<td># Resolved</td>\n<td>The number of reports submitted during the selected time interval that are closed as Resolved.</td>\n</tr>\n<tr>\n<td>% Valid</td>\n<td>The percentage of valid reports submitted during the selected time interval.</td>\n</tr>\n</tbody>\n</table>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-1cd0c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.63878326996198%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Submissions graph on program dashboard"\n        title=""\n        src="/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-2f183.png"\n        srcset="/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-67829.png 125w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-5c59f.png 250w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-2f183.png 500w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-c93e8.png 750w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-4e628.png 1000w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-b3ac4.png 1500w,\n/static/program-dashboard-submissions-28b5f89bfa6d9ecde3926cf644cd4470-1cd0c.png 1578w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="severity">Severity</h3>\nThe Severity section shows how reports and bounties are distributed by severity. You can view trends on how many valid reports are submitted and paid per severity.<br><br>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-87c7e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.33248081841433%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Severity table on program dashboard"\n        title=""\n        src="/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-2f183.png"\n        srcset="/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-67829.png 125w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-5c59f.png 250w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-2f183.png 500w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-c93e8.png 750w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-4e628.png 1000w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-b3ac4.png 1500w,\n/static/program-dashboard-severity-b27b7ab0b7b7afe6582e53c9f881d913-87c7e.png 1564w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="closed">Closed Report States</h3>\nThe Closed Report States table shows how your reports are distributed among the various closed states a report can have.  You can view how many reports were:<br><br>\n<table>\n<thead>\n<tr>\n<th>Item</th>\n<th>Details</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Resolved</td>\n<td>The number of reports that are closed as Resolved.</td>\n</tr>\n<tr>\n<td>Duplicate</td>\n<td>The number of reports that are closed as a Duplicate.</td>\n</tr>\n<tr>\n<td>Informative</td>\n<td>The number of reports that are closed as Informative.</td>\n</tr>\n<tr>\n<td>Not Applicable</td>\n<td>The number of reports that are closed as Not Applicable.</td>\n</tr>\n<tr>\n<td>Spam</td>\n<td>The number of reports that are closed as Spam.</td>\n</tr>\n</tbody>\n</table>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-7b85b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.14852752880921%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Closed Report States on program dashboard"\n        title=""\n        src="/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-2f183.png"\n        srcset="/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-67829.png 125w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-5c59f.png 250w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-2f183.png 500w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-c93e8.png 750w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-4e628.png 1000w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-b3ac4.png 1500w,\n/static/program-dashboard-closed-report-states-ac67887cbd3985e89f0c9d3d4dcb4774-7b85b.png 1562w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="weakness">Weakness</h3>\nThe Weakness section shows how your reports are spread among the different weakness types. You can view what areas you’re receiving the most valid vulnerabilities in so that you can know which vulnerabilities your program is most susceptible to.\n<p><br>You can toggle your weakness data by number of valid reports and also by bounty amounts.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-bbd6f.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.29081632653062%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Weaknesses graph on program dashboard"\n        title=""\n        src="/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-2f183.png"\n        srcset="/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-67829.png 125w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-5c59f.png 250w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-2f183.png 500w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-c93e8.png 750w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-4e628.png 1000w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-b3ac4.png 1500w,\n/static/program-dashboard-weaknesses-f40c1e91edfef26e64a392cad8ae939c-bbd6f.png 1568w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="assets">Assets</h3>\nThe Assets section enables you to explore reports and bounties by asset. You can see which asset you’re receiving the most vulnerabilities in and how much bounty is paid out per asset.\n<p><br>You can toggle your asset data by number of valid reports and also by bounty amounts.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-87c7e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.05626598465473%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Assets graph on program dashboard"\n        title=""\n        src="/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-2f183.png"\n        srcset="/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-67829.png 125w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-5c59f.png 250w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-2f183.png 500w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-c93e8.png 750w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-4e628.png 1000w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-b3ac4.png 1500w,\n/static/program-dashboard-assets-0266eaf7fc5e8bada50b87dc14bb80c4-87c7e.png 1564w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/programs/submissions-dashboard.html",id:"programs/submissions-dashboard",title:"Submissions Dashboard",description:null}}},pathContext:{}}}});
